import React from "react";

function Header() {
  return (
    <header className="header-nav">
      <nav>
        <a class="nav-link" href="#">
          Active link
        </a>
        <a class="nav-link" href="#">
          Link
        </a>
        <a class="nav-link" href="#">
          Disabled link
        </a>
      </nav>
    </header>
  );
}

export default Header;
